window.addEventListener("resize", adjustPreviewScale);

document.addEventListener("DOMContentLoaded", function () {
  loadFromLocalStorage();
  renderBrandList();
  renderTypeList();
  updateDropdowns();
  updateCSSVariables();
  adjustPreviewScale();
});

function loadFromLocalStorage() {
  const savedBrands = localStorage.getItem("filamentLabels_brands");
  const savedTypes = localStorage.getItem("filamentLabels_types");
  const savedSettings = localStorage.getItem("filamentLabels_settings");

  if (savedBrands) {
    try {
      brands = JSON.parse(savedBrands);
    } catch (e) {
      console.error("Error loading brands from localStorage", e);
    }
  }

  if (savedTypes) {
    try {
      filamentTypes = JSON.parse(savedTypes);
    } catch (e) {
      console.error("Error loading types from localStorage", e);
    }
  }

  if (savedSettings) {
    try {
      const settings = JSON.parse(savedSettings);
      if (settings.labelWidth)
        document.getElementById("labelWidth").value = settings.labelWidth;
      if (settings.labelHeight)
        document.getElementById("labelHeight").value = settings.labelHeight;
      if (settings.cornerRadius)
        document.getElementById("cornerRadius").value = settings.cornerRadius;
      if (settings.logoSize)
        document.getElementById("logoSize").value = settings.logoSize;
      if (settings.brandFontSize)
        document.getElementById("brandFontSize").value = settings.brandFontSize;
      if (settings.filamentFontSize)
        document.getElementById("filamentFontSize").value =
          settings.filamentFontSize;
    } catch (e) {
      console.error("Error loading settings from localStorage", e);
    }
  }
}

function saveToLocalStorage() {
  localStorage.setItem("filamentLabels_brands", JSON.stringify(brands));
  localStorage.setItem("filamentLabels_types", JSON.stringify(filamentTypes));

  const settings = {
    labelWidth: document.getElementById("labelWidth").value,
    labelHeight: document.getElementById("labelHeight").value,
    cornerRadius: document.getElementById("cornerRadius").value,
    logoSize: document.getElementById("logoSize").value,
    brandFontSize: document.getElementById("brandFontSize").value,
    filamentFontSize: document.getElementById("filamentFontSize").value,
  };
  localStorage.setItem("filamentLabels_settings", JSON.stringify(settings));
}

function updateCSSVariables() {
  const width = document.getElementById("labelWidth").value;
  const height = document.getElementById("labelHeight").value;
  const radius = document.getElementById("cornerRadius").value;
  const logoSize = document.getElementById("logoSize").value;
  const brandFontSize = document.getElementById("brandFontSize").value;
  const filamentFontSize = document.getElementById("filamentFontSize").value;

  document.body.style.setProperty("--label-width", width + "mm");
  document.body.style.setProperty("--label-height", height + "mm");
  document.body.style.setProperty("--label-border-radius", radius + "mm");
  document.body.style.setProperty("--label-logo-size", logoSize + "mm");
  document.body.style.setProperty(
    "--logo-brand-font-size",
    brandFontSize + "pt"
  );
  document.body.style.setProperty(
    "--logo-filament-font-size",
    filamentFontSize + "pt"
  );

  saveToLocalStorage();
  updatePreview();
  renderCreatedLabels();
}

function addBrand() {
  const name = document.getElementById("brandName").value.trim();
  const logoFile = document.getElementById("brandLogo").files[0];

  if (!name) {
    alert("Please enter a brand name");
    return;
  }

  if (logoFile) {
    const reader = new FileReader();
    reader.onload = function (e) {
      brands.push({ name, logo: e.target.result });
      document.getElementById("brandName").value = "";
      document.getElementById("brandLogo").value = "";
      renderBrandList();
      updateDropdowns();
      saveToLocalStorage();
    };
    reader.readAsDataURL(logoFile);
  } else {
    brands.push({ name, logo: null });
    document.getElementById("brandName").value = "";
    renderBrandList();
    updateDropdowns();
    saveToLocalStorage();
  }
}

function deleteBrand(index) {
  brands.splice(index, 1);
  renderBrandList();
  updateDropdowns();
  saveToLocalStorage();
}

function renderBrandList() {
  const list = document.getElementById("brandList");
  list.innerHTML = brands
    .map(
      (brand, i) => `
        <div class="brand-list-item">
            ${
              brand.logo
                ? `<img src="${brand.logo}" class="brand-logo-small">`
                : '<div style="width:30px;height:30px;background:#eee;"></div>'
            }
            <span class="flex-grow-1">${brand.name}</span>
            <button class="btn btn-sm btn-danger" onclick="deleteBrand(${i})">Delete</button>
        </div>
    `
    )
    .join("");
}

function addType() {
  const name = document.getElementById("typeName").value.trim();
  if (!name) {
    alert("Please enter a type name");
    return;
  }
  if (!filamentTypes.includes(name)) {
    filamentTypes.push(name);
    document.getElementById("typeName").value = "";
    renderTypeList();
    updateDropdowns();
    saveToLocalStorage();
  }
}

function deleteType(index) {
  filamentTypes.splice(index, 1);
  renderTypeList();
  updateDropdowns();
  saveToLocalStorage();
}

function renderTypeList() {
  const list = document.getElementById("typeList");
  list.innerHTML = filamentTypes
    .map(
      (type, i) => `
        <div class="type-list-item">
            <span class="flex-grow-1">${type}</span>
            <button class="btn btn-sm btn-danger" onclick="deleteType(${i})">Delete</button>
        </div>
    `
    )
    .join("");
}

function updateDropdowns() {
  const brandSelect = document.getElementById("selectBrand");
  const typeSelect = document.getElementById("selectType");

  const currentBrand = brandSelect.value;
  const currentType = typeSelect.value;

  brandSelect.innerHTML =
    '<option value="">Select brand...</option>' +
    brands.map((b, i) => `<option value="${i}">${b.name}</option>`).join("");

  typeSelect.innerHTML =
    '<option value="">Select type...</option>' +
    filamentTypes.map((t) => `<option value="${t}">${t}</option>`).join("");

  if (currentBrand && brands[currentBrand]) brandSelect.value = currentBrand;
  if (currentType && filamentTypes.includes(currentType))
    typeSelect.value = currentType;
}

function updatePreview() {
  const preview = document.querySelector("#label-preview .label-container");
  const brandIndex = document.getElementById("selectBrand").value;
  const type = document.getElementById("selectType").value;
  const name = document.getElementById("filamentName").value;

  let brandName = brandIndex !== "" ? brands[brandIndex].name : "Brand Name";
  let brandLogo =
    brandIndex !== "" && brands[brandIndex].logo
      ? brands[brandIndex].logo
      : null;
  let typeName = type || "Type";
  let filamentName = name || "Filament Name";

  preview.innerHTML = `
        <div class="label-text">
            <div class="label-brand">${brandName}</div>
            <div class="label-spacer"></div>
            <div class="label-filamenttype">${typeName}</div>
            <div class="label-filamentname">${filamentName}</div>
        </div>
        ${
          brandLogo
            ? `<img class="label-logo" src="${brandLogo}" alt="logo">`
            : ""
        }
    `;

  adjustPreviewScale();
}

function adjustPreviewScale() {
  const previewContainer = document.getElementById("label-preview");
  const label = previewContainer.querySelector(".label-container");

  if (!label) return;

  const containerWidth = previewContainer.offsetWidth;
  const containerHeight = previewContainer.offsetHeight;

  // Get label dimensions in pixels
  const labelWidth = parseFloat(
    getComputedStyle(document.body).getPropertyValue("--label-width")
  );
  const labelHeight = parseFloat(
    getComputedStyle(document.body).getPropertyValue("--label-height")
  );

  // Convert mm to pixels (approximate: 1mm  3.78px at 96 DPI)
  const mmToPx = 3.78;
  const labelWidthPx = labelWidth * mmToPx;
  const labelHeightPx = labelHeight * mmToPx;

  // Calculate max scale that fits in container with padding
  const padding = 40; // pixels of padding
  const scaleX = (containerWidth - padding) / labelWidthPx;
  const scaleY = (containerHeight - padding) / labelHeightPx;

  // Use the smaller scale to ensure it fits both dimensions
  let scale = Math.min(scaleX, scaleY);

  // Clamp scale between reasonable limits
  scale = Math.max(2, Math.min(scale, 8));

  label.style.transform = `scale(${scale})`;
}

function addLabel() {
  const brandIndex = document.getElementById("selectBrand").value;
  const type = document.getElementById("selectType").value;
  const name = document.getElementById("filamentName").value.trim();

  if (brandIndex === "" || !type || !name) {
    alert("Please fill in all fields");
    return;
  }

  createdLabels.push({
    brand: brands[brandIndex],
    type: type,
    name: name,
  });

  document.getElementById("filamentName").value = "";
  updatePreview();
  renderCreatedLabels();
}

function deleteLabel(index) {
  createdLabels.splice(index, 1);
  renderCreatedLabels();
}

function renderCreatedLabels() {
  const container = document.getElementById("createdLabels");

  container.innerHTML = createdLabels
    .map(
      (label, i) => `
        <div class="col-md-3 col-sm-6 mb-3">
            <div class="card" style="min-width: calc(var(--label-width) * 2 + 40px);">
                <div class="card-body p-2">
                    <div style="display: flex; justify-content: center; align-items: center; min-height: calc(var(--label-height) * 2 + 20px);">
                        <div style="transform: scale(2); transform-origin: center;">
                            <div class="label-container">
                                <div class="label-text">
                                    <div class="label-brand">${
                                      label.brand.name
                                    }</div>
                                    <div class="label-spacer"></div>
                                    <div class="label-filamenttype">${
                                      label.type
                                    }</div>
                                    <div class="label-filamentname">${
                                      label.name
                                    }</div>
                                </div>
                                ${
                                  label.brand.logo
                                    ? `<img class="label-logo" src="${label.brand.logo}" alt="logo">`
                                    : ""
                                }
                            </div>
                        </div>
                    </div>
                    <button class="btn btn-sm btn-danger w-100 mt-2" onclick="deleteLabel(${i})">Delete</button>
                </div>
            </div>
        </div>
    `
    )
    .join("");
}

function exportData() {
  const data = {
    brands: brands,
    filamentTypes: filamentTypes,
  };
  const blob = new Blob([JSON.stringify(data, null, 2)], {
    type: "application/json",
  });
  const url = URL.createObjectURL(blob);
  const a = document.createElement("a");
  a.href = url;
  a.download = "filament-labels-data.json";
  a.click();
}

function importData(event) {
  const file = event.target.files[0];
  if (file) {
    const reader = new FileReader();
    reader.onload = function (e) {
      try {
        const data = JSON.parse(e.target.result);
        if (data.brands) brands = data.brands;
        if (data.filamentTypes) filamentTypes = data.filamentTypes;
        renderBrandList();
        renderTypeList();
        updateDropdowns();
        saveToLocalStorage();
        alert("Data imported successfully!");
      } catch (err) {
        alert("Error importing data: " + err.message);
      }
    };
    reader.readAsText(file);
  }
}

function exportPDF() {
  if (createdLabels.length === 0) {
    alert("Please create some labels first");
    return;
  }

  const { jsPDF } = window.jspdf;

  // Use mm units explicitly
  const doc = new jsPDF({
    unit: "mm",
    format: "a4",
  });

  const width = parseFloat(document.getElementById("labelWidth").value);
  const height = parseFloat(document.getElementById("labelHeight").value);
  const radius = parseFloat(document.getElementById("cornerRadius").value);
  const logoSize = parseFloat(document.getElementById("logoSize").value);
  const brandFontSize = parseFloat(
    document.getElementById("brandFontSize").value
  );
  const filamentFontSize = parseFloat(
    document.getElementById("filamentFontSize").value
  );

  // Single border that grows outward
  const borderWidth = 0.3;

  const spacing = 3;
  const totalWidth = width;
  const totalHeight = height;

  const pageWidth = 210;
  const pageHeight = 297;
  const margin = 10;

  const cols = Math.floor(
    (pageWidth - margin * 2 + spacing) / (totalWidth + spacing)
  );
  const rows = Math.floor(
    (pageHeight - margin * 2 + spacing) / (totalHeight + spacing)
  );

  let currentLabel = 0;
  let pageCount = 0;

  while (currentLabel < createdLabels.length) {
    if (pageCount > 0) doc.addPage();
    pageCount++;

    for (
      let row = 0;
      row < rows && currentLabel < createdLabels.length;
      row++
    ) {
      for (
        let col = 0;
        col < cols && currentLabel < createdLabels.length;
        col++
      ) {
        const x = margin + col * (totalWidth + spacing);
        const y = margin + row * (totalHeight + spacing);

        const label = createdLabels[currentLabel];

        // ---- Border (expanded outward) ----
        doc.setDrawColor(0);
        doc.setLineWidth(borderWidth);
        doc.roundedRect(
          x - borderWidth / 2,
          y - borderWidth / 2,
          width + borderWidth,
          height + borderWidth,
          radius,
          radius,
          "S"
        );

        // ---- Brand ----
        doc.setFontSize(brandFontSize);
        doc.setFont(undefined, "bold");
        const brandTextHeight = brandFontSize * 0.3528;

        doc.text(label.brand.name, x + 1, y + 1 + brandTextHeight);

        // ---- Filament text ----
        doc.setFontSize(filamentFontSize);
        doc.setFont(undefined, "normal");

        const filamentTextHeight = filamentFontSize * 0.3528;
        const textBottomMargin = 1;
        const lineSpacing = 0.5;

        doc.text(
          label.type,
          x + 1,
          y + height - textBottomMargin - filamentTextHeight - lineSpacing
        );

        doc.text(label.name, x + 1, y + height - textBottomMargin);

        // ---- Logo ----
        if (label.brand.logo) {
          try {
            const img = new Image();
            img.src = label.brand.logo;

            const imgW = img.width;
            const imgH = img.height;

            if (imgW > 0 && imgH > 0) {
              const aspect = imgW / imgH;

              let drawW = logoSize;
              let drawH = logoSize;

              if (aspect > 1) {
                // wide image
                drawH = logoSize / aspect;
              } else {
                // tall image
                drawW = logoSize * aspect;
              }

              const imgX = x + width - drawW - 0.5;
              const imgY = y + 0.5 + (logoSize - drawH) / 2;

              doc.addImage(label.brand.logo, "PNG", imgX, imgY, drawW, drawH);
            }
          } catch (err) {
            console.error("Error adding logo:", err);
          }
        }

        currentLabel++;
      }
    }
  }

  doc.save("filament-labels.pdf");
}
